import React from "react";
import Footer from "../Footer";
import HeroSection from "../HeroSection";




let Text = (
  <h1>
    Our story Dear people of Maastricht, we are a group of people cooking at a
    salvation army once a week on either mondays, tuesdays or thursdays from
    15:30 to 17:30.
  </h1>
);


function project() {
  return (
    <div>
      <HeroSection />
      <Footer />
    </div>
  );
}

export default project;
